roject/wordsworth1.jpg',1,'examines, in text and context, the year from December 1798-December 1799 and the first year in Grasmere in 1800. Across this period William and Dorothy Wordsworth\'s lives changed dramatically, and with lasting consequences for both their writing.','goslartograsmere.jpg','image/jpeg',18592,'2011-06-23 17:57:50','2011-06-23 17:57:50','2011-06-23 17:57:50'),(47,'node',41,NULL,'Alexander Street Press',NULL,NULL,0,'',NULL,NULL,NULL,NULL,'2011-06-23 17:57:51','2011-06-23 17:57:51'),(48,'archive',47,'iwrp','Irish Women Poets of the Romantic Period','http://asp6new.alexanderstreet.com/iwrp/iwrp.index.map.aspx','http://asp6new.alexanderstreet.com/custlogo/asplogo100.jpg',0,'',NULL,NULL,NULL,NULL,'2011-06-23 17:57:52','2011-06-23 17:57:52'),(49,'archive',6,'rotunda_dickinson','Emily Dickinson\'s Correspondences','http://rotunda.upress.virginia.edu/edc/','http://rotunda.upress.virginia.edu/images/Rotunda-NINES.png',1,'Unpublished in book form during her lifetime, the poems of Emily Dickinson were nonetheless shared with those she trusted most—through her letters. This XML-based archive brings together 74 poems and letters from Emily’s correspondence with her sister-in-law and primary confidante, Susan Dickinson.','dickson_correspondence.jpg','image/jpeg',24446,'2011-06-23 17:57:53','2011-06-23 17:57:53','2011-06-23 17:57:53'),(50,'archive',6,'rotunda_emilyshore','Journal of Emily Shore: Revised and Expanded','http://rotunda.upress.virginia.edu/EmilyShore/','http://rotunda.upress.virginia.edu/images/Rotunda-NINES.png',0,'',NULL,NULL,NULL,NULL,'2011-06-23 17:57:55','2011-06-23 17:57:55'),(51,'node',41,NULL,'InteLex',NULL,NULL,0,'',NULL,NULL,NULL,NULL,'2011-06-23 17:57:55','2011-06-23 17:57:55'),(52,'archive',51,'intelexWordsworth','The Collected Letters of the Wordsworths','http://pinfo.nlx.com/collections/129','http://pm.nlx.com/xtf/icons/external/intelexlogo.jpg',0,'',NULL,NULL,NULL,NULL,'2011-06-23 17:57:56','2011-06-23 17:57:56'),(53,'node',1,NULL